How about
identify the lines in the text split the text into sentences split the sentences into sections based on the line breaks (could work also with splitting on words as well if needed) verify the sections of the sentence are on consecutive rows In the end certain sections of the sentence might occur on multiple lines forming other sentences so you need to correctly identify the sentences spreading consecutive rows
// define separators for various contexts var separator = new { Lines = new[] { '\n' }, Sentences = new[] { '.', '!', '?' }, Sections = new[] { '\n' }, }; // isolate the lines and their corresponding number var lines = paragraph .Split(separator.Lines, StringSplitOptions.RemoveEmptyEntries) .Select((text, number) => new { Number = number += 1, Text = text, }) .ToList();
// isolate the sentences with corresponding sections and line numbers var sentences = paragraph .Split(separator.Sentences, StringSplitOptions.RemoveEmptyEntries) .Select(sentence => sentence.Trim()) .Select(sentence => new { Text = sentence, Length = sentence.Length, Sections = sentence .Split(separator.Sections) .Select((section, index) => new { Index = index, Text = section, Lines = lines .Where(line => line.Text.Contains(section)) .Select(line => line.Number) }) .OrderBy(section => section.Index) }) .OrderByDescending(p => p.Length) .ToList();
// build the possible combinations of sections within a sentence // and filter only those that are on consecutive lines var results = from sentence in sentences let occurences = sentence.Sections .Select(p => p.Lines) .Cartesian() .Where(p => p.Consecutive()) .SelectMany(p => p) select new { Text = sentence.Text, Length = sentence.Length, Lines = occurences, };
and the end results would look like this
where .Cartesian and .Consecutive are just some helper extension methods over enumerable (see associated gist for the entire source code in linqpad ready format)
public static IEnumerable<T> Yield<T>(this T instance) { yield return instance; } public static IEnumerable<IEnumerable<T>> Cartesian<T>(this IEnumerable<IEnumerable<T>> instance) { var seed = Enumerable.Empty<T>().Yield(); return instance.Aggregate(seed, (accumulator, sequence) => { var results = from vector in accumulator from item in sequence select vector.Concat(new[] { item }); return results; }); } public static bool Consecutive(this IEnumerable<int> instance) { var distinct = instance.Distinct().ToList(); return distinct .Zip(distinct.Skip(1), (a, b) => a + 1 == b) .All(p => p); }
